import React from 'react';
import {StyledLayout} from "./styles/Layout.styled";
// import {Link} from "react-router-dom";
import {Instagram} from '@styled-icons/boxicons-logos/Instagram';
import {Facebook} from  '@styled-icons/entypo-social/Facebook';
import {EmailOutline} from '@styled-icons/evaicons-outline/EmailOutline';



const Layout = ({children}) => {



    return (
        <StyledLayout>
            <nav>
                <h1>Cocktails</h1>
                {/*<Link to='/favourites'><h2>Go to Favourites</h2></Link>*/}
                <div className="socialsContainer">
                <EmailOutline size='50' className='socialIcon' />
                <Instagram size='50' className='socialIcon' />
                <Facebook size='40' className='socialIcon' />
                </div>
            </nav>
            <div>
            {children}
            </div>
            <footer><span>Hello I am Footer</span><span>2022</span></footer>
        </StyledLayout>
    );
};

export default Layout;
